CREATE TABLE `shipping_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `is_default` bit(1) DEFAULT NULL COMMENT '是否默认地址\n            1 默认',
  `consignee` varchar(32) DEFAULT NULL COMMENT '收货人',
