  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(5) NOT NULL DEFAULT '0' COMMENT '补全信息类型 ',
  `nickname` varchar(255) NOT NULL COMMENT '联系人姓名',
  `phone` varchar(255) NOT NULL COMMENT '联系电话',
